issue.body:
When the game picks a random nearby ped to talk to CJ (compliments/taunts), the list also goes over dead peds. CJ will look down on them. The peds can't say anything obviously, but CJ can reply normally with yes/no key binds. This feels awkward. The fix is easy, just check pedstate/health like below:

```cpp
// fn @ 0x43ABA0 (done)
bool CPed::PedIsReadyForConversation(bool bRandomConversation)
{
#if CN_GAMECFG(FIX_DEAD_PEDS_CONVERSATIONS)
    // need a dead/dying check here - dead peds will try to convo, player can reply, feels a bit awkward
    if (!IsAlive() || m_nHealth <= 0.1f)
    {
        return false;
    }
#endif

    if (m_nPedFlags.bInVehicle || GetPedIntelligence()->GetTaskFighting() != nullptr)
    {
        return false;
    }

    // If this is a random conversation, check if the player has no wanted level (might be redundant here?)
    if (bRandomConversation)
    {
        if (FindPlayerPed()->GetWantedLevel() > WANTED_CLEAN)
        {
            return false;  // Player has a wanted level, so ped is not ready for conversation
        }
    }

    i32 moveState = GetMoveState();
    if (moveState == PEDMOVE_JOG || moveState == PEDMOVE_RUN || moveState == PEDMOVE_SPRINT)
    {
        return false;
    }

    // Check if the ped is mission-controlled or not engaged in a partner chat already
    if (GetCharCreatedBy() == MISSION_CHAR ||
        (GetPedIntelligence()->FindTaskByType(CTaskTypes::TASK_COMPLEX_PARTNER_CHAT) == nullptr) &&
            (GetPedIntelligence()->GetEventOfType(CEventTypes::EVENT_CHAT_PARTNER) == nullptr))
    {
        return true;  // Ped is ready for conversation
    }

    return false;  // Default case: ped is not ready for conversation
}
```

I may prepare a PR myself soon, We'll see if I can make it in time.

Do note that the health check here is super important - zombie peds (thanks to CTask* code) will still talk to the player without it.
